(233, '3873077008647', 'RUKAVICA CRNA VEL 10', 'Intras D.O.O.', 0.940, '3873077008647', NULL, 'KM', 'PDV', 17.00, 86, 'kom', 1, '60d45e3dc6a6c5.41675849.png', '<p><span style="color: rgb(66, 66, 66); font-family: &quot;Exo 2&quot;, sans-serif;">Rukavice za zaštitu od mehaničkih rizika s površinskim učinkom. Rukavice su dosta lagane, budući da posjeduje platnenu nadlanicu, pa su stoga odličan izbor u svakodnevnim aktivnostima, a i onim malo zahtjevnijim. Izrađene u skladu sa standardima EN388 i EN 42. Rukavice su namjenjene upotrebi prilikom izvođenja finih građevinskih radova, čišćenja, krečenja, u autoindustriji, transportovanju i skladištenju, stolarstvu, vrtlarstvu i sl.&nbsp;</span></p><p><span style="color: rgb(66, 66, 66); font-family: &quot;Exo 2&quot;, sans-serif;">Veličina: 10</span></p>', 0, '2021-06-15 15:53:02', '2021-06-24 12:28:13'),
(234, '3873077009323', 'RUKAVICA LATEX POWER VEL 10', 'Intras D.O.O.', 1.923, '3873077009323', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d461696394d6.93958713.png', '<p><span style="color: rgb(66, 66, 66); font-family: &quot;Exo 2&quot;, sans-serif;">Rukavice za zaštitu od mehaničkih rizika s površinskim učinkom. Rukavica u florescentnoj boji koja omogućava olakšan rad u noćnim uvjetima; osim iznimno upečatljive boje, radi se o rukavici koja je lagana i prozračna, a u isto vrijeme posjeduje otpornost na abraziju. Izrađene u skladu sa standardima EN388 i EN 42. Jedna od glavnih karakteritika i prednosti ove rukavice je prilagodljivost ruci, što ju čini elastičnom u svim pravcima – kao i kod elastik rukavice. Bitno je istaći da je vrat rukavice Florastik duži od standardnog za cca. 30mm što omogućava veću zaštitu ruku.</span></p><p><span style="color: rgb(66, 66, 66); font-family: &quot;Exo 2&quot;, sans-serif;">&nbsp;Veličina: 10</span></p>', 0, '2021-06-15 15:53:02', '2021-06-24 12:41:45'),
(235, '3873077011449', 'RUKAVICA BENZOL VEL 10', 'Intras D.O.O.', 3.248, '3873077011449', NULL, 'KM', 'PDV', 17.00, 12, 'kom', 1, '60d465fb6c37d1.25291382.png', 'Tri puta izdržljivije od kožnih rukavica namijenjenih teškim poslovima. Pruža i izvrsnu otpornost prema mazivu i uljima, te se ne degradira poput kože ili pamuka. Imaju široki prihvatnik koji olakšava skidanje rukavica. Otporne na sve vrste hemija.<p>Veličina: 10</p>', 0, '2021-06-15 15:53:02', '2021-06-24 13:01:41'),
(236, '3873077011463', 'RUKAVICA ANTI-CUT VEL 10', 'Intras D.O.O.', 7.094, '3873077011463', NULL, 'KM', 'PDV', 17.00, 12, 'kom', 1, '60d4677849a623.21168992.png', 'Pletene bešavne rukavice od DYNEEMA vlakana i najlonskih vlakana sa visokim stepenom otpornosti na prosijecanje. PU sloj sive boje na dlanu i prstima. Namjena im je upotreba pri rukovanju sa oštrim objektima. Koriste se u staklarskim i limarskim radionicama. Savršena rukavica za sve zadatke gdje je neophodna visoka zaštita od abrazije, probijanja ili rezanja.', 0, '2021-06-15 15:53:02', '2021-06-24 13:07:36'),
(237, '3873077016192', 'RUKAVICA CRNA VEL 8', 'Intras D.O.O.', 0.940, '3873077016192', NULL, 'KM', 'PDV', 17.00, 9, 'kom', 1, '60d45e6e4edfc5.78609051.png', '<p><span style="color: rgb(66, 66, 66); font-family: &quot;Exo 2&quot;, sans-serif;">Rukavice za zaštitu od mehaničkih rizika s površinskim učinkom. Rukavice su dosta lagane, budući da posjeduje platnenu nadlanicu, pa su stoga odličan izbor u svakodnevnim aktivnostima, a i onim malo zahtjevnijim. Izrađene u skladu sa standardima EN388 i EN 42. Rukavice su namjenjene upotrebi prilikom izvođenja finih građevinskih radova, čišćenja, krečenja, u autoindustriji, transportovanju i skladištenju, stolarstvu, vrtlarstvu i sl.&nbsp;</span></p><p><span style="color: rgb(66, 66, 66); font-family: &quot;Exo 2&quot;, sans-serif;">Veličina: 8</span></p>', 0, '2021-06-15 15:53:02', '2021-06-24 12:29:02'),
