(239, '3873077016765', 'RUKAVICA HAUSHALT VEL 10 35 CM', 'Intras D.O.O.', 3.504, '3873077016765', NULL, 'KM', 'PDV', 17.00, 8, 'kom', 1, '60d460474b6032.28358730.png', 'Rukavica Haushalt je rukavica od PVC materijala namijenjena za upotrebu u naftnoj i uljnoj industriji kao i u domaćinstvu. Otporna je na benzin, ulje i ostale naftne derivate. Rukavice se primjenjuju najviše u profesijama koje izuskuju rukovanje uljima, hemijsko rukovanje, petrohemiji, domaćinstvu i građevini.<p><br><p>Veličina: 10</p><p>Dužina: 35 cm</p></p>', 0, '2021-06-15 15:53:02', '2021-06-24 12:36:55'),
