(415, '4600897004785', 'BOKAL AKVAFOR ART 2,8 l', 'Akvafor D.O.O.', 27.350, '4600897004785', NULL, 'KM', 'PDV', 17.00, 8, 'kom', 1, '60cc7123e01e40.59840777.jpg', '<p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Efikasan bokal za filtriranje vode poboljšava ukus i miris vaše vode za piće, tako što značajno smanjuje štetne primjese, koje se nalaze u gradskoj vodi.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Bokal posjeduje klizni poklopac za lakše punjenje vode i indikator za naznačavanje preostalog kapaciteta filtera.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Svi djelovi su proizvedeni od materijala odobrenih za kontakt sa hranom, a takođe su i bez BPA hemikalija.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Koristi filter B100-5.</span></p>', 0, '2021-06-15 15:53:03', '2021-06-18 12:10:43'),
(416, '4600987000251', 'MODERN MODEL 2 FILTER ZA VODU', 'Akvafor D.O.O.', 76.838, '4600987000251', NULL, 'KM', 'PDV', 17.00, 10, 'kom', 1, '60d41dd3369296.13521961.png', '<p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Efikasnost pročišćavanja vode iz vodovoda.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Zahvaljujući korištenju jedinstvenih vlaknastih apsorpcionih materijala AQUALEN™ u kombinaciji sa najboljim markama aktivnog uglja, filter Akvafor Modern uspešno i bespovratno uklanja iz vode u toku cjelog svog kapaciteta najčešće nečistoće.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">U pakovanju se nalaze 2 filtera.</span></p>', 0, '2021-06-15 15:53:03', '2021-06-24 07:53:23'),
(417, '4600987000770', 'FAVORIT FILTER ZA VODU', 'Akvafor D.O.O.', 407.991, '4600987000770', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d41e5b357a41.93602206.jpg', '<p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Akvafor Favorit vam obezbjeđuje brzo filtriranje vode i veliki kapacitet filtriranja vode do 12 000 litara.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Idealan je za upotrebu u domaćinstvima, kao i u restoranima, hotelima, kafićima, bolnicama, školama i drugim mjestima.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Tijelo je napravljeno od nerđajućeg čelika koje može da izdrži pritisak do 20 atm.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Jedinstveni dizajn Favorit-a vam omogućava laku i brzu zamjenu filtera.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Zahvaljujući malim dimenzijama, uređaj ne zauzima mnogo prostora.</span></p>', 0, '2021-06-15 15:53:03', '2021-06-24 07:55:39'),
(418, '4600987001104', 'TOPAZ V300 FILTER', 'Akvafor D.O.O.', 17.094, '4600987001104', NULL, 'KM', 'PDV', 17.00, 43, 'kom', 1, '60d41fd7c978a2.06016616.png', '<p>Filter je napravljen po modernoj tehnologiji karbon bloka. Zahvaljujući korišćenju jedinstvenih vlaknastih apsorpcionih materijala AQUALEN™ u kombinaciji sa najboljim markama aktivnog uglja filter uspješno i bespovratno uklanja iz vode ne samo hlor i organska jedinjenja, već i mikroprimjese.</p>', 0, '2021-06-15 15:53:03', '2021-06-24 08:01:59'),
(419, '4600987001111', 'ULOŽAK AKVAFOR TOPAZ', 'Akvafor D.O.O.', 8.547, '4600987001111', NULL, 'KM', 'PDV', 17.00, 59, 'kom', 1, '60d42114335034.28311891.png', '<p>Priključak za slavinu Akvafor Topaz je veoma praktičan filter za vodu. Postavlja se na slavinu i stoji uz nju. Posjeduje prekidač koji omogućava da mijenjate između filtrirane vode ili nefiltrirane, tako da filtriranu vodu možete koristi za piće i kuhanje, a nefiltriranu za pranje sudova. Takođe ima i kalendar koji vas podsjeća kada trebate da promjenite uložak. Mjenjanje uloška je veoma lako.</p>', 0, '2021-06-15 15:53:03', '2021-06-24 08:07:16'),
(420, '4600987001142', 'BOKAL AKVAFOR STANDARD 2,5l SA DOPUNSKIM FILTEROM', 'Akvafor D.O.O.', 22.051, '4600987001142', NULL, 'KM', 'PDV', 17.00, 9, 'kom', 1, '60d024c3007ca2.07273309.jpg', '<p>Efikasan bokal za filtriranje vode poboljšava ukus i miris vaše vode za piće, tako što značajno smanjuje štetne primjese, koje se nalaze u gradskoj vodi. Bokal posjeduje flip-top poklopac za lako punjenje vode. Zahvaljujući kompaktnim dimenzijama ga možete staviti u frižider. Svi djelovi su proizvedeni od materijala odobrenih za kontakt sa hranom, a takođe su i bez BPA hemikalija. Koristi filter: B15 (B100-15)<br></p>', 0, '2021-06-15 15:53:03', '2021-06-21 07:33:55'),
(421, '4600987001661', 'PREDFILTER ZA HLADNU VODU AKVAFOR', NULL, 47.778, NULL, NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, 'none.jpg', NULL, 0, '2021-06-15 15:53:03', '2021-06-15 15:53:03'),
(422, '4600987001777', 'BOKAL AKVAFOR GARRY 3,9l', 'Akvafor D.O.O.', 28.632, '4600987001777', NULL, 'KM', 'PDV', 17.00, 3, 'kom', 1, '60cc707dee4621.09506905.png', '<p><span style="color: rgb(125, 125, 125); font-family: Inter, " open="" sans",="" helveticaneue-light,="" "helvetica="" neue="" light",="" neue",="" helvetica,="" arial,="" "lucida="" grande",="" sans-serif;="" letter-spacing:="" -0.14px;"="">Efikasan bokal za filtriranje vode poboljšava ukus i miris vaše vode za piće, tako što značajno smanjuje štetne primjese, koje se nalaze u gradskoj vodi.</span><br style="color: rgb(125, 125, 125); font-family: Inter, " open="" sans",="" helveticaneue-light,="" "helvetica="" neue="" light",="" neue",="" helvetica,="" arial,="" "lucida="" grande",="" sans-serif;="" letter-spacing:="" -0.14px;"=""><span style="color: rgb(125, 125, 125); font-family: Inter, " open="" sans",="" helveticaneue-light,="" "helvetica="" neue="" light",="" neue",="" helvetica,="" arial,="" "lucida="" grande",="" sans-serif;="" letter-spacing:="" -0.14px;"="">Svi dijelovi su proizvedeni od materijala odobrenih za kontakt sa hranom, a takođe su i bez BPA hemikalija.</span><br></p>', 0, '2021-06-15 15:53:03', '2021-06-18 12:07:57'),
(423, '4600987001883', 'ULOŽAK EFG 63/250-20 MKM', NULL, 5.812, NULL, NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, 'none.jpg', NULL, 0, '2021-06-15 15:53:03', '2021-06-15 15:53:03'),
(424, '4600987001975', 'ULOŽAK EFG 63/250-5MKM', 'Akvafor D.O.O.', 5.812, '4600987001975', NULL, 'KM', 'PDV', 17.00, 59, 'kom', 1, '60d422a81e34b7.00886948.png', '<p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Rezervni filter – EFG 63/250 – 5 mikrona</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Prečišćava vodu od hrđe, pijeska i drugih nečistoća do 5 mikrona.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Odgovara Aquaphor Predfilteru-u za hladnu vodu.</span></p>', 0, '2021-06-15 15:53:03', '2021-06-24 08:14:00'),
(425, '4600987002149', 'ULOŽAK B200 KOMPLET', 'Akvafor D.O.O.', 31.880, '4600987002149', NULL, 'KM', 'PDV', 17.00, 22, 'kom', 1, '60d42447433d62.75869612.png', '<br><p><li style="line-height: 24px; color: rgb(119, 119, 119); font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Zamjenski filter uložak za Aquaphor Modern</li><li style="line-height: 24px; color: rgb(119, 119, 119); font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Sadrži patentirani ionski izmjenjivač – vlakno Aqualen</li><li style="line-height: 24px; color: rgb(119, 119, 119); font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Uklanja iz vode sve nečistoće, ostavljajući samo korisne sastojke</li><li style="line-height: 24px; color: rgb(119, 119, 119); font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Efikasno smanjuje tvrdoću vode, tzv. kamenac</li></p>', 0, '2021-06-15 15:53:03', '2021-06-24 08:20:55'),
(426, '4600987002187', 'KRISTAL N FILTER ZA VODU', 'Akvafor D.O.O.', 192.009, '4600987002187', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d424d1ec8d68.75636567.jpg', '<p>Filter za duboko prečišćavanje i omekšavanje vode za piće. Kompaktno tijelo filtera lako staje pod sudoper, a na sudoperu se stavlja posebna slavina za čistu vodu. Komplet sadrži tjelo Akvafor KRISTAL H, sve potrebne uloške, česmu za prečišćenu vodu i sve neophodne priključke.</p><p>Savremeni slim dizajn, visoko kvalitetna plastika, tehnologija "karbonblok".</p><p>Tri stepena filtriranja:</p><p>&nbsp;1. Dubinsko prečišćavanje vode od hlora, hrđe, teških metala i drugih štetnih sastojaka.</p><p>&nbsp;2. Otklanja tvrdoću (kamenac)</p><p>&nbsp;3. Povećana antibakterijska zaštita</p><p>Koristi promenljive uloške (koji se menjaju zajedno sa tijelom, zbog bakterostatičnosti).</p>', 0, '2021-06-15 15:53:03', '2021-06-24 08:23:13'),
(427, '4600987002262', 'ULOŽAK PROMJENLJIVI AKVAFOR K7B', 'Akvafor D.O.O.', 83.120, '4600987002262', NULL, 'KM', 'PDV', 17.00, 3, 'kom', 1, '60d428e437e166.89871667.jpg', '<ul style="color: rgb(119, 119, 119); font-family: &quot;Open Sans&quot;, Arial, sans-serif;"><li style="line-height: 24px;">Uložak za mikrofiltraciju</li><li style="line-height: 24px;">Uklanja bakterije 99,9%</li><li style="line-height: 24px;">Suvremeni slim dizajn</li><li style="line-height: 24px;">Koristi se s uređajima koji se montiraju ispod sudopera</li><li style="line-height: 24px;">Jednostavna zamjena filter uloška</li></ul>', 0, '2021-06-15 15:53:03', '2021-06-24 08:40:36'),
(428, '4600987002354', 'BOKAL AKVAFOR LINE 2,8l', 'Akvafor D.O.O.', 22.051, '4600987002354', NULL, 'KM', 'PDV', 17.00, 0, 'kom', 1, '60d0239728f6b5.71835503.jpg', '<p font-size:="" font-weight:="" open=""><span style="font-size: 12px;"><span style="font-weight: 700;">Tehničke specifikacije:</span></span></p><ul font-size:="" open=""><li font-size:="" open="" style="margin: 0px 0px 10px;"><span style="font-size: 12px;">Zapremina bokala ukupna/korisna zapremina: 2,8/1,2 L</span></li><li font-size:="" open="" style="margin: 0px 0px 10px;"><span style="font-size: 12px;">Zapremina ljevka: 1,2 L</span></li><li font-size:="" open="" style="margin: 0px 0px 10px;"><span style="font-size: 12px;">Brzina filtriranja:&nbsp;<span font-size:="" open="">3-10 min po lijevku</span></span></li><li font-size:="" open="" style="margin: 0px 0px 10px;"><span style="font-size: 12px;">Model poklopca: običan</span></li><li font-size:="" open="" style="margin: 0px 0px 10px;"><span style="font-size: 12px;">Promjenljivi uložak: B100-15&nbsp;</span></li><li font-size:="" open="" style="margin: 0px 0px 10px;"><span style="font-size: 12px;">Kapacitet uloška: 170 L&nbsp;</span></li><li font-size:="" open="" style="margin: 0px 0px 10px;"><span style="font-size: 12px;">Preporučena zamjena (za tri osobe): svaki mjesec&nbsp;</span></li><li font-size:="" open="" style="margin: 0px 0px 10px;"><span style="font-size: 12px;">Indikator kapaciteta filtera: nema</span></li><li font-size:="" open="" style="margin: 0px 0px 10px;"><span style="font-size: 12px;">dostupne boje: bijela i plava.&nbsp;&nbsp;</span>&nbsp;&nbsp;</li></ul>', 0, '2021-06-15 15:53:03', '2021-06-21 07:28:55'),
(429, '4600987002828', 'KRISTAL SOLO FILTER ZA VODU', 'Akvafor D.O.O.', 125.812, '4600987002828', NULL, 'KM', 'PDV', 17.00, 2, 'kom', 1, '60d429618cdef8.16910962.png', '<p>Filter za dodatno prečišćavanje vode za piće. Ultrakompaktno tijelo filtera lako staje pod sudoperu, a na površinu se stavlja posebna slavina za čistu vodu. Uređaj ima elegantan dizajn, koji je napravljen od izdržljivog materijala. Zauzima mali prostor ispod sudopere, a pritom ima veliki kapacitet. Čisti vodu od hlora, organskih jedinjenja i drugih nečistoća.</p>', 0, '2021-06-15 15:53:03', '2021-06-24 08:42:41'),
(430, '4600987002910', 'TIJELO FILTERA ZA VODU VIKING MINI', 'Akvafor D.O.O.', 316.325, '4600987002910', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d42a23f322a2.58999469.png', '<p><span style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;">Aquaphor Viking Mini – moderni je apsorpcioni filter koji je sposoban da prečisti svu vodu u manjim stanovima, kafićima, u generalno manjim objektima, od aktivnog hlora, organskih jedinjenja, jona, teških metala, rđe i neprijatnih mirisa.To znači da ćete Vi, Vaše dete i Vaši najbliži ne samo piti čistu vodu, već se i kupati u njoj. Prioriteti filtera Aquaphor Viking Mini su solidna brzina prečišćavanja, kapacitet i odličan kvalitet prečišćene vode. Viking Mini ne samo da će zaštiti tehniku, već i vaše zdravlje. Telo Viking Mini je napravljeno od prohroma, tako da može da izdrži veoma visoke pritiske u vodi.</span></p><br style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;"><p><span style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;">KORISTI DVA TIPA ULOŠKA:</span></p><br style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;"><p><span style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;">Prvi tip (za prečišćavanje isključivo hladne vode): B505-13</span></p><p><span style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;">Prečišćava vodu od: rđe, olova, aktivnog hlora, fenola, teških metala i pesticida.</span></p><p><span style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;">Kapacitet: 30.000 L</span></p><p><span style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;">Brzina filtriranja: 10 L/min</span></p><p><span style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;">Temperatura vode: +5...+38°C</span></p><br style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;"><p><span style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;">Drugi tip (za prečišćavanja isključivo tople vode): B505-14</span></p><p><span style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;">Prečišćava vodu od: rđe, olova, aktivnog hlora, fenola, teških metala i pesticida.</span></p><p><span style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;">Kapacitet: 15.000 L</span></p><p><span style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;">Brzina filtriranja: 15 L/min</span></p><p><span style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;">Temperatura vode: +5...+75°C</span></p><br style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;"><p><span style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;">Obratite pažnju! Filter i telo Aquaphor Viking Mini se kupuju posebno!</span></p>', 0, '2021-06-15 15:53:03', '2021-06-24 08:45:55'),
(431, '4600987002934', 'ULOZAK PROMJENJIVI AKVAFOR B505-13', 'Akvafor D.O.O.', 76.581, '4600987002934', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d42bb0b98ef3.28677671.jpg', '<ul><li style="line-height: 24px;">Sadrži Aqualen</li><li style="line-height: 24px;">Modul se sastoji od dva koaksijalno smještena karbonbloka</li><li style="line-height: 24px;">Pročišćava znatno više vode u usporedbi s analozima</li><li style="line-height: 24px;">Visoka brzina pročišćavanja vode zahvaljujući korištenju patentiranih tehnologija</li></ul><p style="margin-bottom: 15px; color: rgb(0, 0, 0); line-height: 24px;">Zamjenski filter uložak B505-13 koristi se u vodovodnim sustavima&nbsp;<a href="https://www.aquaphor.com.hr/shop/filteri-za-vodu/kuciste-inox-filtera-aquaphor-viking-mini" target="_blank" title="Uređaj za filtriranje vode Viking mini" style="color: rgb(19, 92, 171); outline: none !important;">Viking Mini</a>&nbsp;za pročišćavanje hladne vode u cijelom objektu.<br>Uložak se sastoji od dva koaksijalno smještena karbonbloka, vanjski blok je izrađen od granula aktivnog ugljena i vlakana Aqualena, njegova propusnost je10 mikrona, dok propusnost unutarnjeg bloka je znatno manja, samo 5 mikrona. Zahvaljujući ovom jedinstvenom dizajnu, voda se čisti od nečistoća, taloga i zagađivača kao što je klor, sa neznatnim padom vodoopskrbnog tlaka.</p><ul><li style="line-height: 24px;">Boja prirubnice je smeđa (oznaka za hladnu vodu).</li><li style="line-height: 24px;">Uložak je namijenjen za pročišćavanje hladne vode.</li><li style="line-height: 24px;">Kapacitet pročišćavanja: 30.000 litara</li><li style="line-height: 24px;">Brzina pročišćavanja: 10 l/min</li><li style="line-height: 24px;">Radna temperatura: od +5 do +400C</li></ul><p style="margin-bottom: 15px; color: rgb(0, 0, 0); line-height: 24px;"><span style="font-weight: 700;">Pročišćava od nečistoća:</span></p><ul><li style="line-height: 24px;">Klor: &gt;50%</li><li style="line-height: 24px;">Fenol: &gt;50%</li><li style="line-height: 24px;">Naftni derivati:&gt;50%</li><li style="line-height: 24px;">Pesticidi: &gt;50%</li><li style="line-height: 24px;">Trihalometani:&gt;50%</li><li style="line-height: 24px;">Teški metali: &gt;50%</li></ul><p style="margin-bottom: 15px; color: rgb(0, 0, 0); line-height: 24px;">Vijek trajanja filter uloška ovisi od učestalosti korištenja i kvaliteti ulazne vode.</p>', 0, '2021-06-15 15:53:03', '2021-06-24 08:53:37'),
