(444, '4744131010182', 'BOKAL AKVAFOR AGAT 3,8l', 'Akvafor D.O.O.', 28.632, '4744131010182', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d42e79ec1857.88722097.png', '<p><span style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;">Efikasan bokal za filtriranje vode poboljšava ukus i miris vaše vode za piće, tako što značajno smanjuje štetne primese koje se nalaze u gradskoj vodi.</span></p><br style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;"><p><span style="color: rgb(43, 27, 53); font-family: &quot;Proxima Nova&quot;, Roboto, Helvetica, sans-serif; font-size: 16px;">Bokal ima jednostavan i praktičan dizajn. Veća zapremina bokala pruža komforniju upotrebu za veće porodice. Svi delovi su proizvedeni od materijala odobrenih za kontakt sa hranom, a takođe su i bez BPA hemikalija.</span></p>', 0, '2021-06-15 15:53:03', '2021-06-24 09:04:25'),
(445, '4744131010335', 'ULOŽAK AKVAFOR B100-25 KOMPLET 3 KOM.', 'Akvafor D.O.O.', 11.111, '4744131010335', NULL, 'KM', 'PDV', 17.00, 176, 'kom', 1, '60d02bcab0a486.72820857.jpg', '<p>Značajno smanjuje skoro sve najčešće nečistoće u gradskoj vodi, poboljšava boju vode, ukus i miris. Kapacitet filtera – 200 litara. 3 komada u pakovanju.</p><p>Pročišćava vodu:</p><ul><li>od hlora 100%</li><li>od fenola 99%</li><li>od teških metala 98%</li><li>od hrđe 100%</li><li>od pesticida 95%</li><li>od naftnih derivata 98%</li></ul><p>Filteri kao baktericidnu dopunu sadrže srebro što sprječava razmnožavanje bakterija.<br>Propuštaju prirodne mineralne sastojke.<br>Ne mjenjaju prirodnu PH vrijednost.<br>Uklanjaju suvišnu tvrdoću vode (kamenac).<br>Preporučeni za dječiju ishranu!</p><p>Koristi se za bokale Akvafor: Agat, Ametist, Tajm, Orion i za bokale drugih proizvođača: Brita Maxtra, Laica, itd.</p>', 0, '2021-06-15 15:53:03', '2021-06-21 08:03:54'),
(446, '4744131010489', 'BOKAL AKVAFOR AMETIST PLAVA BOJA 2,8L', 'Akvafor D.O.O.', 22.051, '4744131010489', NULL, 'KM', 'PDV', 17.00, 14, 'kom', 1, '60d42facc0a547.77694663.jpg', '<h2 style="box-sizing: inherit; border: 0px; font-size: 1.5rem; margin: 0px 0px 0.7em; outline: 0px; padding: 0px; vertical-align: baseline; clear: both; color: rgb(0, 0, 0); line-height: 1.3; font-family: Raleway, sans-serif; -webkit-tap-highlight-color: transparent !important;">Bokal za filtriranje vode – Ametist</h2><p style="box-sizing: inherit; border: 0px; font-size: 18px; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0); font-family: Raleway, sans-serif; -webkit-tap-highlight-color: transparent !important;">Bokal za filtriranje vode – Ametist je efikasan bokal za filtriranje vode poboljšava ukus i miris vaše vode za piće, tako što značajno smanjuje štetne primese koje se nalaze u gradskoj vodi.</p><p style="box-sizing: inherit; border: 0px; font-size: 18px; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0); font-family: Raleway, sans-serif; -webkit-tap-highlight-color: transparent !important;">Poseduje indikator kapaciteta filtera koji vam pokazuje koliko je vremena ostalo do zamene uloška. Takođe poseduje poseban poklopac, koji za razliku od drugih bokala ne zahteva skidanje celog poklopca, jer ima poseban otvor za sipanje vode (klizni poklopac). Svi delovi su proizvedeni od materijala odobrenih za kontakt sa hranom. Telo bokala je napravljeno od materijala Tritan – BPA free!</p><p style="box-sizing: inherit; border: 0px; font-size: 18px; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0); font-family: Raleway, sans-serif; -webkit-tap-highlight-color: transparent !important;">U pakovanju se uz bokal dobija jedan filter B100-25 (200 L).<br style="-webkit-tap-highlight-color: transparent !important; box-sizing: inherit;">Zapremina bokala: 1.5 L prečišćenje vode</p><p style="box-sizing: inherit; border: 0px; font-size: 18px; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 0, 0); font-family: Raleway, sans-serif; -webkit-tap-highlight-color: transparent !important;"><span style="box-sizing: inherit; border: 0px; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; -webkit-tap-highlight-color: transparent !important;">Kompatibilni filteri:&nbsp;</span><a href="https://www.akvafor.me/proizvodi/b100-25/" style="box-sizing: inherit; border: 0px; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 73, 188); transition: all 0.2s linear 0s; -webkit-tap-highlight-color: transparent !important;"><span style="box-sizing: inherit; -webkit-tap-highlight-color: transparent !important;">B100-25</span></a>,&nbsp;<a href="https://www.akvafor.me/proizvodi/b100-25-2u1/" style="box-sizing: inherit; border: 0px; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 73, 188); transition: all 0.2s linear 0s; -webkit-tap-highlight-color: transparent !important;"><span style="box-sizing: inherit; border: 0px; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; -webkit-tap-highlight-color: transparent !important;">B100-25 2u1</span></a>,&nbsp;<a href="https://www.akvafor.me/proizvodi/b100-25-3u1/" style="box-sizing: inherit; border: 0px; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 73, 188); transition: all 0.2s linear 0s; -webkit-tap-highlight-color: transparent !important;"><span style="box-sizing: inherit; border: 0px; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; -webkit-tap-highlight-color: transparent !important;">B100-25 3u1</span></a>,&nbsp;<a href="https://www.akvafor.me/proizvodi/b100-25-mg/" style="box-sizing: inherit; border: 0px; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 73, 188); transition: all 0.2s linear 0s; -webkit-tap-highlight-color: transparent !important;"><span style="box-sizing: inherit; border: 0px; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; -webkit-tap-highlight-color: transparent !important;">B100-25 Mg+</span></a>,&nbsp;<a href="https://www.akvafor.me/proizvodi/b100-25-mg-3u1/" style="box-sizing: inherit; border: 0px; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 73, 188); transition: all 0.2s linear 0s; -webkit-tap-highlight-color: transparent !important;"><span style="box-sizing: inherit; border: 0px; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; -webkit-tap-highlight-color: transparent !important;">B100-25 Mg+ 3u1</span></a>.</p>', 0, '2021-06-15 15:53:03', '2021-06-24 09:09:32'),
