(452, '4744131010915', 'ULOZAK PROMJENJIVI AKVAFOR K7', 'Akvafor D.O.O.', 21.752, '4744131010915', NULL, 'KM', 'PDV', 17.00, 7, 'kom', 1, '60d43efab91204.19713333.png', '<p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Efikasno i bespovratno uklanja čak i mikro količine štetnih sastojaka, uključujući aktivni hlor, teške metale i organska jedinjenja.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Efikasno filtrira nerastvorive primjese, dimenzije od 0,8 mikrona.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Odgovara uređaju: Akvafor OSMO-100-K-4A</span></p>', 0, '2021-06-15 15:53:03', '2021-06-24 10:14:50'),
(453, '4744131010946', 'ULOŽAK K5 ZA RO', 'Akvafor D.O.O.', 18.803, '4744131010946', NULL, 'KM', 'PDV', 17.00, 5, 'kom', 1, '60d44765e15e90.68284282.jpg', '<p style="margin-bottom: 15px; color: rgb(0, 0, 0); line-height: 24px; font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Zamjenski filter uložak K5&nbsp;namijenjen je za pročišćavanje vode od mehaničkih nečistoća takvih kao pjesak, hrđa, mulj&nbsp;te&nbsp;ima visoku otpornost na djelovanje bakterija i kemikalija. Koristi se kao uložak broj 1&nbsp;za Automat za pitku vodu DWM 101 Morion te za Uređaje za pročišćavanje vode Crystal trio i quattro. Štiti sljedeće za njim u uređaju&nbsp;filter uloške.</p><p style="margin-bottom: 15px; color: rgb(0, 0, 0); line-height: 24px; font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Filter uložak je lako zamijeniti:&nbsp;pritisnite gumb,&nbsp;okrenite i izvadite&nbsp;stari uložak, stavite novi uložak i okrenite ga&nbsp;dok ne čujete "klik".</p><p style="margin-bottom: 15px; color: rgb(0, 0, 0); line-height: 24px; font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Kapacitet: od 1 do 6 mjeseci ovisno o kvaliteti vode.</p>', 0, '2021-06-15 15:53:03', '2021-06-24 10:50:45'),
