(457, '4744131011318', 'ULOZAK PROMJENJIVI AKVAFOR B150', 'Akvafor D.O.O.', 75.470, '4744131011318', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d44c13d382e5.15860363.png', '<p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Veliki kapacitet protoka i filtracije.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Karbon blok struktura filtera daje optimalnu kombinaciju vlaknastih i granularnih komponenti koje uklanjaju klor, organske spojeve i teške metale iz vode.</span></p>', 0, '2021-06-15 15:53:03', '2021-06-24 11:10:43'),
(458, '4744131011349', 'ULOŽAK AKVAFOR B100-25 MG PLUS', 'Akvafor D.O.O.', 5.641, '4744131011349', NULL, 'KM', 'PDV', 17.00, 138, 'kom', 1, '60d02c1b0d8007.10757407.jpg', '<p>Pored toga što značajno smanjuje skoro sve najčešće nečistoće u gradskoj vodi, obogaćuje vodu magnezijumom. Poboljšava boju vode, ukus i miris. Kapacitet filtera – 200 litara. 1 komad u pakovanju.</p><p><span style="font-weight: 700;">Pročišćava vodu:</span></p><ul><li>od hlora 100%</li><li>od fenola 99%</li><li>od teških metala 98%</li><li>od hrđe 100%</li><li>od pesticida 95%</li><li>od naftnih derivata 98%</li></ul><p>- Filteri kao baktericidnu dopunu sadrže srebro što sprječava razmnožavanje bakterija.<br>- Propuštaju prirodne mineralne sastojke.<br>- Ne mjenjaju prirodnu PH vrijednost.<br>- Uklanjaju suvišnu tvrdoću vode (kamenac).<br>- Obogaćuju vodu magnezijumom.<br>- Preporučeni za dečiju ishranu!</p><p>Koristi se za bokale Akvafor: Agat, Ametist, Tajm, Orion i za bokale drugih proizvođača: Brita Maxtra, Laica, itd.</p>', 0, '2021-06-15 15:53:03', '2021-06-21 08:05:15'),
