(461, '4744131011431', 'ULOZAK EFG 63/250 - 20 MKM AKVAFOR', 'Akvafor D.O.O.', 5.812, '4744131011431', NULL, 'KM', 'PDV', 17.00, 10, 'kom', 1, '60d44e9fea17b3.77473557.png', '<p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Rezervni filter – EFG 63/250 – 20 mikrona</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Prečišćava vodu od hrđe, pijeska i drugih nečistoća do 20 mikrona.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Odgovara Aquaphor Predfilteru-u za hladnu vodu.</span></p>', 0, '2021-06-15 15:53:03', '2021-06-24 11:21:35'),
(462, '4744131011738', 'TIJELO FILTERA ZA VODU GROSS MIDI', 'Akvafor D.O.O.', 133.590, '4744131011738', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d44d88e2f386.44212152.png', '<p style="margin-bottom: 1rem; color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Kućište Akvafor Gross 20” je napravljeno od plastike, ojačane staklenim vlaknima, može da izdrži visok pritisak i opremljen je zgodnim pokretnim držačem.</p><p style="margin-bottom: 1rem; color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Zamjena filtrirajućeg uloška je veoma jednostavna zahvaljujući priključku koji se brzo povezuje.</p><p style="margin-bottom: 1rem; color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Akvafor Gross 20” efikasno uklanja pijesak, hrđu, mulj i druge primjese, olakšava rad filtera za prečišćavanje pitke vode, štiti kućnu tehniku od kvarova, čini tuširanje i kupanje prijatnijim.</p>', 0, '2021-06-15 15:53:03', '2021-06-24 11:16:56'),
