(464, '4744131013466', 'BOKAL AKVAFOR SMILE 2,5L', 'Akvafor D.O.O.', 23.077, '4744131013466', NULL, 'KM', 'PDV', 17.00, 0, 'kom', 1, '60cc75636a8335.78348412.jpg', '<p><br><li style="line-height: 24px; color: rgb(119, 119, 119); font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Ukupni volumen 2,4&nbsp;litara</li><li style="line-height: 24px; color: rgb(119, 119, 119); font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Slim dizajn - vrč stane u vrata hladnjaka</li><li style="line-height: 24px; color: rgb(119, 119, 119); font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Kapacitet pročišćavanja zamjenskog uloška: 350 l</li><li style="line-height: 24px; color: rgb(119, 119, 119); font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Nije potrebno skidati polopac za punjenje vrča vodom</li><li style="line-height: 24px; color: rgb(119, 119, 119); font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Zamjenski filter-uložak A5&nbsp;pouzdano pročišćava vodu od svih uobičajenih nečistoća: klora, organskih spojeva, hrđe, teških metala, pesticida&nbsp;i drugih nečistoća</li></p>', 0, '2021-06-15 15:53:03', '2021-06-18 12:28:51');
