(465, '4744131013480', 'BOKAL AKVAFOR IDEAL SA DOPUNSKIM FILTEROM 2,8l', 'Akvafor D.O.O.', 22.051, '4744131013480', NULL, 'KM', 'PDV', 17.00, 38, 'kom', 1, '60cc6f77dce096.35979241.jpg', '<p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Efikasan bokal za filtriranje vode poboljšava ukus i miris vaše vode za piće, tako što značajno smanjuje štetne primjese, koje se nalaze u gradskoj vodi.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Bokal posjeduje klizni poklopac za lakše punjenje vode i indikator za naznačavanje preostalog kapaciteta filtera.</span></p><p><span style="color: rgb(125, 125, 125); font-family: Inter, &quot;Open Sans&quot;, HelveticaNeue-Light, &quot;Helvetica Neue Light&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; letter-spacing: -0.14px;">Svi djelovi su proizvedeni od materijala odobrenih za kontakt sa hranom, a takođe su i bez BPA hemikalija. Koristi filter: B15 (B100-15).</span></p>', 0, '2021-06-15 15:53:03', '2021-06-18 12:03:35'),
