(566, '7517843', 'TASKI DEGRAGERM SMARTDOSE 1,4L', 'Ecotime D.O.O', 60.684, '7517843', NULL, 'KM', 'PDV', 17.00, 0, 'kom', 1, '60d308b718c4b8.06389139.jpg', '<p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><span style="border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">TASKI® Sprint Degragerm SD</span>&nbsp;je deterdžent, dezinficijens i dezodorans za podove i ostale površine.<br>Radi se o visoko koncentrisanom dnevnom sredstvu za čišćenje svih vrsta tvrdih površina otpornih na vodu podova, uključujući zaštićene podove premazom.</p><ul style="border: 0px; margin-right: 0px; margin-bottom: 24px; margin-left: 15px; outline: 0px; padding: 0px; vertical-align: baseline; clear: both; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Baktericidna, fungicidna i virusoidna aktivnost</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Čisti bez izmjene sjaja emulzija na podovima</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Svježi miris bora</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Efikasan na niskim dozama</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Bez pjenjenja</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Prikladno i kontrolisano doziranje kroz SmartDose sistem doziranja</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Svojstva proizvoda garantuju higijenu i sigurnost sprječavajući unakrsnu kontaminaciju</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Moguće je koristiti na većini podova i površina, uključujući zaštićene podove</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Miris bora je prilagođen zdravstvenoj industriji i povećava percepciju čistoće u vašim prostorima, ostavljajući iza sebe svježi miris</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Moguće je koristiti na površinama nanošenjem prskalicom ili krpom i kantom, kao i u mašinama za ribanje i mopom i kantom na podovima</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">SmartDose sistem osigurava jednostavno, precizno, sigurno doziranje super koncentrata</li></ul><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><span style="border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Doziranje:</span>&nbsp;Precizno doziranje smanjuje troškove i smanjuje utjicaj na okolinu. SmartDose sistem doziranja može biti korišćen za kontrolisano doziranje u boce ili u kante za čišćenje.</p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; 