(581, '7615400155064', 'CIF PROF.PEĆ. I GRIL 750ml', 'Ecotime D.O.O', 7.778, '7615400155064', NULL, 'KM', 'PDV', 17.00, 11, 'kom', 1, '60cdc4125091c4.36552004.png', '<p>Transportno pakovanje: 6 komada</p><p><span style="background-repeat: no-repeat; color: rgb(102, 102, 102); font-family: Roboto, sans-serif;">Profesionalno sredstvo za čišćenje pećnica i grilova.</span><br style="background-repeat: no-repeat; color: rgb(102, 102, 102); font-family: Roboto, sans-serif;"><span style="color: rgb(102, 102, 102); font-family: Roboto, sans-serif;">Za upotrebu na pećnicama, roštilima i drugim površinama. Način upotrebe: Zagrijati površinu za čišćenje između 50º-70º. Isključite aparat. Nanesite Cif na površinu i ostavite 20-30 minuta. Isperite temeljito sa čistom vodom.</span><br></p>', 0, '2021-06-15 15:53:03', '2021-06-19 12:16:50'),
