(583, '7615400183333', 'SUMA ALCOHOL SPRAY D4,12.750ML,KITCHEN CARE', 'Ecotime D.O.O', 11.068, '7615400183333', NULL, 'KM', 'PDV', 17.00, 10, 'kom', 1, '60d06df3e5c644.70964125.jpg', '<p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><span style="border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Suma Alcohol Spray D4.12</span>&nbsp;je brzodjelujući sprej za dezinfekciju za upotrebu u kuhinjama i prostorijama za pripremu/posluživanje hrane. Proizvod je siguran za upotrebu na kontaktnim površinama za pripremu hrane i brzo isparava, ne ostavljajući ostatke. Prikladan je za dezinfekciju površina u dodiru s hranom te pomagala kao što su mesoreznice, ploče za rezanje hrane, pribor za rezanje, termometri, stolovi i druga manja kuhinjska oprema. Također je prikladan za dezinfekciju vitrina za izlaganje hrane u supermarketima, mesnicama itd.<br>SumaAlcohol SprayD4.12 temelji se na etanolu i formulisan je za optimalni biocidni učinak. Ima širok spektar djelovanja i djelotvoran je protiv većine vegetativnih oblika mikroorganizama.</p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">izbjegavajte raspršivanje na polikarbonat i druge plastične materijale (npr. pleksiglas ili akrilat) koji su podložni pucanju prilikom naprezanja. U slučaju nesigurnosti, preporučljivo je procijeniti pojedinačne materijale prije dužeg korišćenja.</p>', 0, '2021-06-15 15:53:03', '2021-06-21 12:46:11'),
(584, '7615400187966', 'SUMA CALC D5 ZA ODSTR.KAMENCA 5L', 'Ecotime D.O.O', 67.179, '7615400187966', NULL, 'KM', 'PDV', 17.00, 2, 'kom', 1, '60d06f59aee9d5.21306158.png', '<p style="font-family: Raleway, sans-serif;"><span style="color: rgb(0, 41, 112); font-family: &quot;Open Sans&quot;, sans-serif; border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Suma Calc D5</span><span style="color: rgb(0, 41, 112); font-family: &quot;Open Sans&quot;, sans-serif;">&nbsp;je koncentrisano kiselo sredstvo namijenjeno odstranjivanju kamenca sa kuhinjske opreme, posuđa i mašine za pranje posuđa.</span><br></p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: " work="" sans",="" arial,="" helvetica,="" sans-serif;="" letter-spacing:="" 0.7px;"="">Suma Calc D5 je kiselo sredstvo, koje zbog optimalne kombinacije anorganskih kiselina i nejonskih tenzida efikasno odstranjuje anorganske ostatke na kuhinjskim pomagalima, mašinama za pranje suđa, …<br>Prednosti:<br> Efikasno odstranjuje anorganske obloge<br> Radi koncentrisanosti i preciznog doziranja je vrlo ekonomično<br> Odstranjuje oksidne obloge</p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: " work="" sans",="" arial,="" helvetica,="" sans-serif;="" letter-spacing:="" 0.7px;"="">Čiščenje mašina za pranje suđa: Doziranje: 30 – 100 ml na 1 L vode<br>1. Isključimo pumpe<br>2. Mašinu napunimo vodom<br>3. Pustimo, da djeluje 10 – 15 minuta<br>4. Po potrebi postupak ponovimo</p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: " work="" sans",="" arial,="" helvetica,="" sans-serif;="" letter-spacing:="" 0.7px;"="">Namakanje:<br>1. Doziranje : 50 – 200 ml (5 – 20%) na 1 L vruće vode<br>2. Potopiti predmet u otopinu dok se nakupine ne razgrade<br>3. Sastrugati ako je potrebno<br>4. Temeljno isprati<br>Sprej čišćenje:<br>1. Doziranje: 200 ml (20%) na 1 L tople vode<br>2. Ostaviti bar 30 min da djeluje i iščetkati<br>3. Temeljno isprati toplom vodom</p>', 0, '2021-06-15 15:53:03', '2021-06-21 12:52:53'),
