(587, '7615400764471', 'DET. ZA SUĐE PROF. SUN 1L', 'Ecotime D.O.O', 5.043, '7615400764471', NULL, 'KM', 'PDV', 17.00, 18, 'kom', 1, '60d077596a4ce1.91956229.jpg', '<p><span style="border: 0px; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">SUN Professional Wul</span><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">&nbsp;je koncentrovani deterdžent za ručno pranje suđa sa svježim mirisom citrusa.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Deterdžent SUN je proizvod za ručno pranje pribora, suđa i čaša. Brzo i pouzdano uklanja ostatke, prljavštinu i osušene skorele nečistoće sa posuđa, šerpi, lonaca, tava i slično. Staklo i pribor (beštek) se takođe mogu prati. Deterdžent za pranje suđa Sun Professional ima bujnu pjenu i ugodan je za kožu.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Prednosti:</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• pere bez tragova ostavljajući sjajne površine</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• lako uklanja masnoće, skrob i bjelančevina</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• velika snaga čišćenja</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• bujno pjenjenja</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• sa svježim mirisom citrusa</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• posebno kompatibilan s kožom</span></p>', 0, '2021-06-15 15:53:03', '2021-06-21 13:26:17'),
(588, '7615400771929', 'SUMA BAR L66 ZA MAŠ. PRANJE ČAŠA 5L', 'Ecotime D.O.O', 50.000, '7615400771929', NULL, 'KM', 'PDV', 17.00, 8, 'kom', 1, '60d077cea0ef57.31262620.jpg', '<p><span style="border: 0px; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Suma Bar L 66</span><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">&nbsp;je koncentrisano sredstvo za pranje čaša i posuđa, koje doseže odlične rezultate pri svim tvrdoćama vode.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Suma Bar L66 sadrži visoko aktivne komponente alkalija koje dobro odstranjuju masne mrlje te osiguravaju odlično odstranjivanje zaprljanja stakla, keramike i umjetnih masa pri čemu ne šteti dekoracijama.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Suma Bar L66 je Unileverov SEAC »Safety and Environmental Assurance Centre« pri pravilnoj upotrebi ocijenio kao sigurno sredstvo.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Prednosti:</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• Brzo i temeljno odstranjivanje masnoće i proteinskih ostataka.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• Sprečava nastajanje vodenog kamenca.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• Sredstvo je visoko koncentrisano i zato izvanredno ekonomično pri upotrebi.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• Posebni sastojci sprečavaju uništenje dekoracije na čašama i posuđu.</span></p>', 0, '2021-06-15 15:53:03', '2021-06-21 13:28:14'),
