(745, '8003850', 'TASKI ERGODISC 165,230 V/50 Hz', 'Ecotime D.O.O', 3046.154, '8003850', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d07f41796381.62070625.jpg', '<p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Disk mašina za temeljna čišćenja podova sa 165 obrtaja u minuti.</span></p><p style="font-family: Raleway, sans-serif;">Specijalno opremljen stroj za izvršavanje sljedećih zadataka: mokro ribanje, odstranjivanje starih premaza, poliranje, čišćenje raspršivanjem, šamponiranje, tretiranje drvenih površina, kristalizacija.</p><ul style="font-family: Raleway, sans-serif;"><li>Radna površina(cm): 43</li><li>Broj okretaja/min: 165</li><li>Težina(kg): 37</li><li>Dodatna težina(kg): 5kg</li><li>Nominalna potrošnja(W): 1100</li><li>Napon(V / Hz): 230/50</li><li>Dužina kabla(m): 15</li><li>Pritisak četke(N/cm2): 0.3</li></ul><p style="font-family: Raleway, sans-serif;">Potrebna oprema za ovaj stroj sastoji se od vodilnog kola 43cm ( 8504410/ 8505090) i četke (ovisno o potrebi 8504750/ 8504780/ 8504800/ 8504830/ 8504860), te tank za čistu vodu(8504390). Dostupna je i kao opcionalna oprema agregat za šamponiranje(8504660).</p>', 0, '2021-06-15 15:53:03', '2021-06-21 14:00:01'),
(746, '8004270', 'TASKI VACUMAT 22 230V/50HZ', 'Ecotime D.O.O', 1224.786, '8004270', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d07fc3a7c831.93696197.jpg', '<p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Industrijski usisivač za suvo/mokro usisavanje sa brojnim dodacima</p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Ključne osobine:</p><ul style="border: 0px; margin-right: 0px; margin-bottom: 24px; margin-left: 15px; outline: 0px; padding: 0px; vertical-align: baseline; clear: both; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Maksimalna fleksibilnost</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Velika funkcionalnost</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Povećana produktivnost</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Čvrstoća i trajnost</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">22 T integrisana kolica</li></ul><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><span style="border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Maksimalna fleksibilnost</span><br>Mokri / suvi usisivač jednostavno se može opremiti za suvo usisavanje korišćenjem kompleta za suvo usisavanje koji se lako može pričvrstiti. To čini usisivač multifunkcionalnim za bilo koju vrstu suvog usisavanja na tvrdim i mekim kao i mokrim podovima.</p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><span style="border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Velika funkcionalnost</span><br>Zbog velikog broja mogućnosti, usisavač se može koristiti za osnovno čišćenje u kombinaciji s TASKI mašinama sa jednim diskom, za prosipanje ili svakodnevno čišćenje.</p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><span style="border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Povećana produktivnost</span><br>Velika usisna snaga u kombinaciji sa odličnom upravljivošću i velikim kapacitetom rezervoara povećava efikasnost rada.</p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><span style="border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Čvrstoća i trajnost</span><br>Posebno dizajnirani mehanički plutajući sistem sa dvostrukim filterom garantuje dvostruku zaštitu motornog agregata i značajno produžava radni vijek. Otporan na udarce i hemikalije, rezervoar osigurava visoku izdržljivost.</p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><span style="border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">22 T integrisana kolica</span><br>Usisavač vacumat 22 T uključuje kao opciju visoko upravljiva kolica sa gumom kako bi se omogućilo efikasnije čišćenje i uklanjanje tečnosti</p>', 0, '2021-06-15 15:53:03', '2021-06-21 14:02:11'),
