(1335, '8711202911330', 'SUMA A5-ZA MAŠ.PRANJE POSUĐA 5L', 'Ecotime D.O.O', 44.017, '8711202911330', NULL, 'KM', 'PDV', 17.00, 7, 'kom', 1, '60d081f3767881.52097392.jpg', '<p><span style="border: 0px; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Suma Rinse A5</span><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">&nbsp;je univerzalno koncetrovano profesionalno sredstvo za mašinsko ispiranje posuđa primjenljivo za korišćenje u širokom spektru profesionalnih mašina sa jednim ili više rezervoara (ELECTROLUX,WINTERHALTER,BOBECK, itd ). Suma Rinse A5 je sastavljen od neionskih tenzida koji omogućavaju odlično sušenje bez ostavljanja tragova. Rezultat sušenja nije zavisan od tvrdoće vode. Suma Rinse A5 je Unileverov SEAC »Safety and Environmental Assurance Centre« pri pravilnoj upotrebi ocijenio kao sigurno sredstvo.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Prednosti:</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"> Obezbjeđuje brzo sušenje</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"> Ne ostavlja tragove na posuđu</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"> Sprečava pjenjenje</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Uputstvo za upotrebu Suma Rinse A5 se dodaje u zadnjem ispiranju pri temperaturi cca. 70-80 °C. Doziramo ga obzirom na uslove (kvalitet vode, stepena zaprljanja, …) Prosječne vrijednosti su 0,2 – 0,5 ml/l</span></p>', 0, '2021-06-15 15:53:04', '2021-06-21 14:11:31'),
