(1591, 'N4600987008325', 'BOKAL AKVAFOR PROVANCE 4,2l', 'Akvafor D.O.O.', 28.632, 'N4600987008325', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60cc749decfbd4.41926662.jpg', '<p><font color="#000000" face="Open Sans, Arial, sans-serif"><br></font></p><ul style="color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, Arial, sans-serif;"><li style="line-height: 24px;">Volumen 4,2 litara</li><li style="line-height: 24px;">Kapacitet pročišćavanja zamjenskog uloška: 300 l</li><li style="line-height: 24px;">Zauzima malo mjesta u kuhinji</li><li style="line-height: 24px;">Prikladan je za pročišćavanje vode kod kuće, u uredu, u vikendici</li><li style="line-height: 24px;">Zamjenski filter-uložak A5 koji pouzdano pročišćava vodu od svih uobičajenih zagađivača vode: klora, organskih spojeva, bakterija i drugih nečistoća.</li></ul><p style="margin-bottom: 15px; color: rgb(0, 0, 0); line-height: 24px; font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Vrč za pročišćavanje vode Provance – izvor čiste i ukusne osvježavajuće vode. Pročišćava vodu tamo gdje Vam treba. Osigurava pročišćavanje velike količine vode odjednom.<br>Zahvaljujući profinjenom i ergonomičnom dizajnu rukovati vrčem Provance je lako i udobno.</p><ul style="color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, Arial, sans-serif;"><li style="line-height: 24px;">Ne treba Vam priključak na vodovod za njegovo korištenje</li><li style="line-height: 24px;">Ovo je najveći vrč koji postoji na tržištu</li><li style="line-height: 24px;">Poklopac vrča dizajniran je tako da štiti vodu od prašine</li><li style="line-height: 24px;">Poklopac modela „flip-flop“ ima ugrađen mehanički brojač potrošnje zamjenskog filtera</li><li style="line-height: 24px;">Vrlo je jednostavan za uporabu – samo napunite ulazni spremnik vodom i pričekate da se ona očisti</li><li style="line-height: 24px;">Zauzet će malo mjesta u Vašoj kuhinji i uljepšati njezin interijer</li><li style="line-height: 24px;">Proizveden od visokokvalitetne, ekološki prihvatljive plastike namijenjene za prehranu</li><li style="line-height: 24px;">Voda pročišćena filtrima Aquaphor preporučena je za pripremu dječje hrane kod kuće</li></ul><p style="margin-bottom: 15px; color: rgb(0, 0, 0); line-height: 24px; font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Kapacitet pročišćavanja vode: 350 l – 3-mjesečna zaliha čiste vode za tročlanu obitelj.</p><p style="margin-bottom: 15px; color: rgb(0, 0, 0); line-height: 24px; font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Pročišćava vodu od:</p><ul style="color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, Arial, sans-serif;"><li style="line-height: 24px;">Aktivnog klora 100%</li><li style="line-height: 24px;">Naftnih derivata 95%</li><li style="line-height: 24px;">Fenola 99%</li><li style="line-height: 24px;">Pesticida 99%</li><li style="line-height: 24px;">Teških metala 99%</li></ul><p><font color="#000000" face="Open Sans, Arial, sans-serif">Koristi se sa:&nbsp;</font></p><p><font color="#000000" face="Open Sans, Arial, sans-serif">Zamjenski uložak: A5 2/1</font></p><p><span style="color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Zamjenski uložak:&nbsp; Mg + A5 2/1</span><font color="#000000" face="Open Sans, Arial, sans-serif"><br></font></p>', 0, '2021-06-15 15:53:05', '2021-06-18 12:25:33');
