(1592, 'N4744131011844', 'BOKAL AKVAFOR ONYX 4,2l', 'Akvafor D.O.O.', 28.632, 'N4744131011844', NULL, 'KM', 'PDV', 17.00, 0, 'kom', 1, '60cc75deab92e9.94054129.jpg', '<ul style="color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, Arial, sans-serif;"><li style="line-height: 24px;">Volumen 4,2 litara</li><li style="line-height: 24px;">U kompletu s zamjenskim uloškom B100-25+</li><li style="line-height: 24px;">Kapacitet pročišćavanja zamjenskog uloška: 200 l</li><li style="line-height: 24px;">Zauzima malo mjesta u kuhinji</li><li style="line-height: 24px;">Prikladan je za pročišćavanje vode kod kuće, u uredu, u vikendici</li></ul><p style="margin-bottom: 15px; color: rgb(0, 0, 0); line-height: 24px; font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Vrč se koristi sa zamjenskim filter-ulošcima&nbsp;В100-25 ili B100-25 Mg plus&nbsp;koji&nbsp;pouzdano pročišćavaju vodu od svih uobičajenih nečistoće koje se mogu naći u vodi: klora, organskih spojeva, bakterija i drugih nečistoća.</p><ul style="color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, Arial, sans-serif;"><li style="line-height: 24px;">Ne treba Vam priključak na vodovod za njegovo korištenje</li><li style="line-height: 24px;">Ovo je najveći vrč koji postoji na tržištu</li><li style="line-height: 24px;">Poklopac vrča dizajniran je tako da štiti vodu od prašine</li><li style="line-height: 24px;">Poklopac modela „flip-flop“ ima ugrađen mehanički brojač potrošnje zamjenskog filtera</li><li style="line-height: 24px;">Vrlo je jednostavan za uporabu – samo napunite ulazni spremnik vodom i pričekate da se ona očisti</li><li style="line-height: 24px;">Zauzet će malo mjesta u Vašoj kuhinji i uljepšati njezin interijer</li><li style="line-height: 24px;">Proizveden od visokokvalitetne, ekološki prihvatljive plastike namijenjene za prehranu</li><li style="line-height: 24px;">Voda pročišćena filtrima Aquaphor preporučena je za pripremu dječje hrane kod kuće</li></ul><p style="margin-bottom: 15px; color: rgb(0, 0, 0); line-height: 24px; font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Kapacitet pročišćavanja vode: 200 l – 1,5-2-mjesečna zaliha čiste vode za tročlanu obitelj<br></p><p style="margin-bottom: 15px; color: rgb(0, 0, 0); line-height: 24px; font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Pročišćava vodu od:</p><p style="margin-bottom: 15px; color: rgb(0, 0, 0); line-height: 24px; font-family: &quot;Open Sans&quot;, Arial, sans-serif;">Aktivnog klora 100%<br>Naftnih derivata 95%<br>Fenola 99%<br>Pesticida 99%<br>Teških metala 99%</p>', 0, '2021-06-15 15:53:05', '2021-06-18 12:30:54'),
