(1889, 'RA078', 'CLAX  BIOEXTRA AUTOMAT 18kG', 'Ecotime D.O.O', 99.915, 'RA078', NULL, 'KM', 'PDV', 17.00, 4, 'kom', 1, '60d08404166f65.17753808.jpg', '<p><span style="border: 0px; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Clax® Bioextra Automat&nbsp;</span><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">je enzimski deterdžent za pranje veša specijalno formulisan za korišćenje u komercijalnim i prometnim vešerajima. Proizvod je razvijen za ručno doziranje i može se koristiti u uslovima meke i srednje tvrde vode. CLAX Bioextra Automat je pogodan za pranje svih bijelih i obojenih artikala. CLAX Bioextra Automat je enzimski prašak sa miksom efektivnih surfaktanata i enzima, ne sadrži fosfate. Surfaktanti obezbjeđuju odlično uklanjanje zaprljanja kako na visokim tako i na niskim temperaturama, dok enzimi efektivno uklanjaju proteinske nečistoće pri srednjim temperaturama. Proizvod takođe sadrži izbjeljivač na bazi aktivnog kiseonika koji garantuje izbjeljivanje preostalih fleka na nižim temperaturama od 40˚C.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Prednosti</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"> Efikasno uklanja masne i proteinske fleke</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"> Odlične performanse pranja pri srednjim i nižim temperaturama</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"> Pogodan za ručno doziranje</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Doziranje:</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"> Pretpranje 5-12 g/kg suvog veša</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"> Glavno pranje 8-20 g/kg suvog veša</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"> Potapanje 2-8 g/kg suvog veša</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Takođe provjeriti uputstvo na etiketi.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Za najbolje rezultate:</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"> Koristiti omekšanu vodu</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"> Odvojiti poliester pamuk od drugih tkanina</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"> Odvojiti bijeli i obojeni veš</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"> Sortirati na manje, srednje i jako zaprljani veš</span></p>', 0, '2021-06-15 15:53:05', '2021-06-21 14:20:20'),
