(1906, 'RA097', 'KOLICA S KANTAMA 2X25L,VALJ.CJEDILO', 'Ecotime D.O.O', 321.966, 'RA097', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d1d1e7997505.89079573.jpg', '<p><span style="color: rgb(119, 119, 119); font-family: Arial, Helvetica, sans-serif, Arial, Helvetica, sans-serif;">Kolica sa dvije kante sa cjedilom za čišćenje u uredima, hotelima, zdravstvenim ustanovama, trgovačkim centrima. Kotačići u kolici isključuju ometanje i osiguravaju ujednačeno kretanje. Mehanička cjedilo od otporne plastike. Kromirani štap omogućuje jednostavno upravljanje kolicom.</span></p>', 0, '2021-06-15 15:53:05', '2021-06-22 14:04:55'),
(1907, 'RA098', 'NOSAČ MOPA ZA MOKRO BRISANJE,PLASTIČNI', 'Ecotime D.O.O', 50.598, 'RA098', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d1d2b2aad4a3.23774506.jpg', '<p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• Blik potpora, plastični okvir, efikasan i siguran, pogodan za sve ravne mopove sa džepovima.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• Zahvaljujući okruglom žutom dugletu možete ugodno i tiho otvoriti okvir.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• Zaobljeni rubovi za lakše umetanje glave krpe i ravnog dna kako biste izvršili ravnomjerni pritisak pranja na glavi krpe za efikasnije čišćenje.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• Sa automatskim patentiranim sistemom spajanja za bolju ergonomiju: zahvaljujući njemu, bilo koji mop sa džepovima može se staviti na okvir, bez više savijanja tokom pranja i vrlo malo kontakata sa prljavštinom i hemijskim otopinama.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• Lagana, praktična i ekološka, jer je izrađena od vrhunskih plastičnih materijala.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• Zglobni&nbsp; od 360 ° omogućava rukovaocu da ga lako pomiče dosežući dijelove poda ispod namještaja.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• Univerzalni prsten omogućava upotrebu bilo koje ručke promjera od 18 do 23 mm.</span></p>', 0, '2021-06-15 15:53:05', '2021-06-22 14:08:18'),
(1908, 'RA099', 'TASKI AERO 8 EURO,220V, 13L', 'Ecotime D.O.O', 469.658, 'RA099', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d1d3b577cf61.50958297.png', '<p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">TASKI aero je asortiman ultra tihih usisivača za suvo usisavanje. Dostupni modeli:</p><ul style="border: 0px; margin-right: 0px; margin-bottom: 24px; margin-left: 15px; outline: 0px; padding: 0px; vertical-align: baseline; clear: both; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">TASKI aero 8 (13L vrećica)</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">TASKI aero 8 plus (13L vrećica, eco dugme, pokazivač popunjenosti kese, namotaj za kabal)</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">TASKI aero 15 (15L vrećica, uski i četka dodatak za usisavanje)</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">TASKI aero 15 plus (15L vrećica, uski i četka dodatak za usisavanje, eco dugme, pokazivač popunjenosti kese, namotaj za kabal)</li></ul><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><span style="border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Ključne osobine:</span></p><ul style="border: 0px; margin-right: 0px; margin-bottom: 24px; margin-left: 15px; outline: 0px; padding: 0px; vertical-align: baseline; clear: both; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Napredne osobine u jedinstvenoj kombinaciji</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Održivi koncept visoke efikasnosti sa Eko funkcijom</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Ultra tiha TASKI tehnologija rada</li><li style="border: 0px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Dizajniran i testiran u skladu s najboljom operativnom praksom</li></ul><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><span style="border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Kompaktan i robusan TASKI dizajn</span><br>Funkcionalan, kompaktan i robusan dizajn omogućava skladištenje u malim prostorima ili ormarićima. Integrisana ergonomska ručka takođe ga čini vrlo jednostavnim za nošenje i pruža jednostavan i praktičan ručni kabal.</p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><span style="border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Koncept održive visoke efikasnosti</span><br>Novi usisavači TASKI AERO vrlo su efikasni i koriste vrhunski vakuumski motor od 585 W koji pruža iste performanse čišćenja kao i usisavači sa 900 W ili više. To se postiže genijalnim sistemom protoka vazduha. Kao rezultat, usisavač štedi značajne količine energije i smanjuje emisiju CO2, bez da na bilo koji način utiče na rezultate čišćenja.</p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><span style="border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Ultra tiha TASKI tehnologija rada</span><br>Zahvaljujući inovativnoj i patentiranoj tehnologiji rada, TASKI AERO je izuzetno tih. Ovaj nizak nivo buke znači da se može raditi u bilo kojem okruženju u bilo koje doba dana ili noći.</p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><span style="border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Dizajniran i testiran u skladu s najboljom operativnom praksom</span><br>Proizvod je dizajniran za vrlo često profesionalno čišćenje u bilo kojem okruženju. Svaki aspekt proizvoda temelji se na opsežnoj procjeni kupca i procesa sa ciljem postizanja najvišeg kvaliteta čišćenja i najbolje radne efikasnosti. U pogledu ergonomskog dizajna, TASKI AERO je bez premca, s nožnim prekidačem, visokokvalitetnim priborom koji je standardno postavljen.</p>', 0, '2021-06-15 15:53:05', '2021-06-22 14:12:37'),
