(1911, 'RA102', 'TASKI VREĆ.PAPIRNE ZA AERO 8/15,10/1', 'Ecotime D.O.O', 36.667, 'RA102', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d1d79d3fa884.58703937.png', '<p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><span style="border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">TASKI Aero papirne vrećice</span></p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Ove vrećice za usisavanje izrađene su od visokokvalitetnog papirnog materijala u Njemačkoj i savršeno su dizajnirane za usisivače TASKI Aero 8/15 Plus. U potpunosti ispunjavaju mogućnosti usisavanja i filtriranj; preporučujemo zamjenu vrećice za prašinu svaka 2 mjeseca. Oni koji pate od alergija, trebali bi ga zamjenjivati svaki mjesec. Zahvaljujući najnovijim mikro tehnologijama , ova vrećica usisavača omogućuje dugotrajniju usisnu snagu u kombinaciji sa većim volumenom punjenja.</p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Obratite pažnju na zaštitni filter motora iza vrećice sa prašinom i ispušni filter na izlazu vašeg usisavača TASKI Aero 15 Plus. Upotrijebite opcijski univerzalni filtar koji zatim možete pojedinačno smanjiti na potrebnu&nbsp; veličinu. Možete koristiti stari filtar kao predložak. Dodatne Hepa filtre trebali biste zamijeniti jednom godišnje</p>', 0, '2021-06-15 15:53:05', '2021-06-22 14:29:17'),
(1912, 'RA115', 'BRISAČ STAKLA SA GUMOM 35 cm', 'Ecotime D.O.O', 23.761, 'RA115', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d1d87d92d8b1.89977300.png', '<p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;"><span style="border: 0px; font-style: inherit; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">TTS Brisač stakla od inoxa</span></p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">• Fiksni brisač od nerđajućeg čelika<br>• Za profesionalno sušenje prozora.<br>• Sastoji se od ručke i nosača od nerđajućeg čelika sa gumom.<br>• Potpuno nerđajući, omogućuju rukovaocu da savršeno očisti površinu jednim brisanjem zahvaljujući glatkoći gume</p><p style="border: 0px; margin-top: 20px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Ručka je prekrivena gumom. Čisti savršeno površinu jednim brisanjem zahvaljujući glatkoći gume koja se može lako zamijeniti kada se potroši. Čišćenje se radi brisanjem sa “S” pokretima od vrha prozora-stakla prema dolje. Koristite teleskopske drške za velike staklene prozore bez upotrebe ljestvi.</p>', 0, '2021-06-15 15:53:05', '2021-06-22 14:33:01'),
