(1914, 'RA117', 'KRPA ZA PRANJE STAKLA 35cm', 'Ecotime D.O.O', 13.675, 'RA117', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d1d9da58bd33.14320736.jpg', '', 0, '2021-06-15 15:53:05', '2021-06-22 14:38:50'),
(1915, 'RA118', 'MAGIČNA KRPA TASKY MYMICRO, ZELENA', 'Ecotime D.O.O', 3.932, 'RA118', NULL, 'KM', 'PDV', 17.00, 18, 'kom', 1, '60d179e2123ab0.65253281.jpg', '<p><span style="font-family: Raleway, sans-serif;">MyMicro krpa od mikrofibera daje sjajne rezultate čišćenja sa svakim korišćenjem. Fina vlakna od kojih je sačinjena čine da bolje prianja na površinu i time otklanja više prljavštine, prašine i bakterija od običnih krpa. Može se prati mašinski do 300 puta na 95°C. bez omekšivača i izbjeljivača.</span></p><br style="font-family: Raleway, sans-serif;"><p><span style="font-family: Raleway, sans-serif;">Dimenzije: 35 x 35 cm</span></p><br style="font-family: Raleway, sans-serif;"><br style="font-family: Raleway, sans-serif;"><p><span style="font-family: Raleway, sans-serif;">Pakovanje: 1 komad</span></p>', 0, '2021-06-15 15:53:05', '2021-06-22 07:49:22'),
(1916, 'RA121', 'PVC FOLIJA 7MIC,45cmX300m 3/1', 'Ecotime D.O.O', 63.590, 'RA121', NULL, 'KM', 'PDV', 17.00, 0, 'kom', 1, '60d1db16828c92.73254527.png', '<p style="font-family: Raleway, sans-serif;">PVC folija 7microna</p><p style="font-family: Raleway, sans-serif;">Dimenzije: 45cmx300m</p><p style="font-family: Raleway, sans-serif;">Pakiranje: 3/1</p><p style="font-family: Raleway, sans-serif;">Većina profesionalnih kuhara i ugostitelja koriste PVC foliju jer ima najbolja svojstva prijanjanja i pogodna je za umatanje svih vrsta hrane, osim za čiste masti, ulje i hranu pohranjenu u masnim posudama.</p>', 0, '2021-06-15 15:53:05', '2021-06-22 14:44:06'),
(1917, 'RA123', 'KANTA +NOSAČ+MOP MICROF. SQUIZZY', 'Ecotime D.O.O', 168.034, 'RA123', NULL, 'KM', 'PDV', 17.00, 0, 'kom', 1, '60d1dc08d7de94.52206589.png', '<p><span style="font-family: Raleway, sans-serif;">Kanta sa pregradom koja razdvaja čistu i prljavu vodu</span></p><p><span style="font-family: Raleway, sans-serif;">• Integrirani valjci za cijeđenje mopa</span></p><p><span style="font-family: Raleway, sans-serif;">• Polipropelinska ručka</span></p><p><span style="font-family: Raleway, sans-serif;">• 4 točkića za lagano upravljanje</span></p><p><span style="font-family: Raleway, sans-serif;">• Nosač mopa</span></p><p><span style="font-family: Raleway, sans-serif;">• Mop microfiber 0699</span></p>', 0, '2021-06-15 15:53:05', '2021-06-22 14:48:08'),
(1918, 'RA124', 'KANTA S ZEL.RUČKOM+MOP+NOSAČ UNI JUNIOR', 'Ecotime D.O.O', 60.256, 'RA124', NULL, 'KM', 'PDV', 17.00, 1, 'kom', 1, '60d1dd64299658.43461267.png', '<p><span style="font-family: Raleway, sans-serif;">Uni Junior praktični je, lagani i visoko higijenski poluprofesionalni sustav koji uključuje inovacije i snage Uni System-a, profesionalnog sustava za pranje i dezinfekciju: rezultat je učinkovito i bez napora čišćenje. Uni Junior osigurava visoku razinu higijene zahvaljujući sustavu zakačenja i otkačivanja bez dodira koji omogućuje ravnu krpu da se lako pričvrsti na okvir, a zatim ukloni bez dodira s rukom.Izbjegavanje bilo kakvog izravnog kontakta s prljavštinom osigurava maksimalnu kontrolu unakrsnog onečišćenja.Uni Junior nema ograničenja i može se koristiti neselektivno za čišćenje vodoravnih i okomitih površina, osiguravajući visoke performanse u oba slučaja. Prednosti profesionalnog čišćenja dostupne su svima zahvaljujući Uni Junioru, kombinaciji tehnologije, ergonomije i učinkovitosti koja osigurava maksimalne performanse i higijenu.</span></p><p style="font-family: Raleway, sans-serif;"><div style="font-family: Raleway, sans-serif;"></div></p><p style="font-family: Raleway, sans-serif;">Bez savijanja pri uporabišto štiti leđa i zglobove.</p><p style="font-family: Raleway, sans-serif;">Bez kontaktai potencijalne kontaminacije.</p><p style="font-family: Raleway, sans-serif;">Ispravna težina koja osigurava trenje na površinama bez velikog napora.</p><p style="font-family: Raleway, sans-serif;">Prava vlažnost za pranje, izbjegavanje ostataka i sprječavanje klizanja.</p>', 0, '2021-06-15 15:53:05', '2021-06-22 14:53:56'),
(1919, 'RA125', 'MOP ZA MOKRO BRISANJE, TROB,POLIEST+PAMUK+MICR', 'Ecotime D.O.O', 17.735, 'RA125', NULL, 'KM', 'PDV', 17.00, 2, 'kom', 1, '60d1dfc88d8e92.57004545.png', '<p style="font-family: Raleway, sans-serif;">Mop od mješavine tri vlakna – pamuk, poliester i mikrofiber. Kombinacija ova tri materijala garantira vrhunske rezultate. Koristi se uz pripadajući držač mopa (0868), što omogućuje cijeđenje mopa bez dodira sa sredstvom. Ovaj sistem koristi se u bolnicama, hotelima, restoranima i velikim komercijalnim zgradama po cijelom svijetu. Lužnata sredstva mogu oštetiti vlakna mopa (pH&lt;11).Može se prati na temperaturama do 90°C, ne koristiti izbjeljivač (skraćuje životni vijek mikrofibera), ne sušiti u sušilici.</p><p style="font-family: Raleway, sans-serif;">Dimenzije: 40 x 13 cm</p>', 0, '2021-06-15 15:53:05', '2021-06-22 15:04:08');
