(1920, 'RA126', 'MOP UNI JUNIOR 35CM', 'Ecotime D.O.O', 13.632, 'RA126', NULL, 'KM', 'PDV', 17.00, 3, 'kom', 1, '60d1e17ab4aee1.22850628.png', '<p style="font-family: Raleway, sans-serif;">Mop od mikrovlakana za mokro čišćenje.&nbsp;</p><p style="font-family: Raleway, sans-serif;">Idealno za čišćenje vodoravnih i okomitih površina. Dizajniran za čišćenje glatkih, umjereno prljavih površina. Zahvaljujući zelenim&nbsp; trakama od grubih vlakana, mop od mikrovlakana zahtijeva manje hemikalija za uklanjanje prljavštine i bakterija, smanjujući potrošnju deterdženta i vrijeme čišćenja.</p><br><p style="font-family: Raleway, sans-serif;">Veličina: 35 x 15cm</p><p style="font-family: Raleway, sans-serif;">Temperatura pranja max 90 °C.</p><p style="font-family: Raleway, sans-serif;">Ne koristite omekšivače ili izbjeljivače od hlora.</p><p style="font-family: Raleway, sans-serif;">Podnosi 300-350 pranja. Sušiti na niskoj temperaturi.</p>', 0, '2021-06-15 15:53:05', '2021-06-22 15:11:22'),
