(1949, '7615400168194', 'OPTIMAX DETERDŽENT ZA PERILICU 5L', 'Ecotime D.O.O', 39.231, '7615400168194', NULL, 'KM', 'PDV', 17.00, 2, 'kom', 1, '60d4505bad5122.27084156.jpg', '<p><span style="border: 0px; font-weight: 600; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">OPTIMAX Detergen</span><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">t je koncentrisano alkalno sredstvo za automatsko pranje posuđa koje sadrži visok udio površinski aktivnih tvari koje osiguravaju efikasno uklanjanje nečistoća i u uslovima tvrde vode (iznad 25 ° F).</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Prednosti:</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">OPTIMAX Detergent omogućava optimalno korištenje proizvoda, čak u uslovima osobito tvrde vode, pri čemu se posuđe optimalno čisti i održava.Kada se sredstvo koristi u preporučenim koncentracijama smanjuje se potreba za pranje mašine kiselim sredstvom za uklanjanje kamenca čime se smanjuju operativni troškovi.</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">•Efikasno uklanja nečistoće, masnoće i ostatke hrane sa posuđa</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">•Efikasan kod različitih tvrdoća vode</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">•Stabilna pjena znači dugotrajno djelovanje sredstva</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">•Ekonomičan za upotrebu, ne sadrži fosfate</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Korištenje:</span></p><p><span style="color: rgb(0, 41, 112); font-family: &quot;Work Sans&quot;, Arial, Helvetica, sans-serif; letter-spacing: 0.7px;">Proizvod se dozira putem automatske opreme za doziranje. Doziranje varira od 1 g / l do 3 g / l, ovisno o uvjetima (tvrdoći vode</span></p>', 0, '2021-06-23 09:35:17', '2021-06-24 11:28:59'),
